import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        < input placeholder = 'Input Anything' />
        <select>
          <option value='success'>Success</option>
          <option value='warning'>Warning</option>
          <option value='error'>Error</option>
        </select>
      </div>
    </div>
  );
}

export default App;
